import Sesion from "./Sesion";
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Sidebar from './Navbar/Sidebar';
import Perfil from './Perfil';
import CardCrearProyectos from './CardCrearProyectos';
import MenuLider from './MenuLider'
import fondoLogin from "../assets/img/fondoLogin.jpg"
import CerrarSesion from './Navbar/CerrarSesion';
import { Fragment } from "react";
import React, {Component} from 'react'; 
import '../assets/css/Menu.css';

class Menu extends Component{
    
    render()
    {
        let usuario =JSON.parse(sessionStorage.getItem('usuarioActivo'));


        return(  
         <Fragment>
                   
              
                    <Router>
                        <Sidebar/> 
                        <Route path="/Sesion" exact component={Sesion}/> 
                        <Route path="/Perfil" exact component={Perfil}/> 
                        <Route path="/CerrarSesion" exact component={CerrarSesion}/>   
                        <Route path="/MenuLider" exact component={MenuLider}/>    
                    </Router>
                    <div className="">
                            <img src={fondoLogin} className="fondoLogin"/>
                    </div>
                    <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                            <h3>Bienvenido Coordinador {usuario.map(usuario=> <div>{usuario.nombres} {usuario.apellidos}</div>)}</h3>
                            </div>
                    <div className="container ">

                  

                        <div className="row align-items-center justify-content-center center-block minh-100">
                            
                     

                            <div className="col-xs-6 col-sm-6 col-md-6 col-lg-4">
                             <CardCrearProyectos/>     
                                  
                            </div>

                            <div className="col-xs-6 col-sm-6  col-md-6 col-lg-4">
                            
                            <CardCrearProyectos/>     
                                  
                            </div>
                        </div>
                    </div>

                    
         </Fragment>
        ) 
    }
        
}export default Menu;
